// ✅ App.js (수정 버전)
import React, { useState } from 'react';
import ProductItem from './ProductItem';
import Summary from './Summary';

const initialProducts = [
  { id: 1, name: 'Columbia Nariñó', price: 5000, image: 'https://i.imgur.com/HKOFQYa.jpeg' },
  { id: 2, name: 'Brazil Serra Do Caparaó', price: 5000, image: 'https://i.imgur.com/HKOFQYa.jpeg' },
  { id: 3, name: 'Columbia Nariñó', price: 5000, image: 'https://i.imgur.com/HKOFQYa.jpeg' },
];

function App() {
  const [cart, setCart] = useState({});
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [postcode, setPostcode] = useState('');

  const addToCart = (product) => {
    setCart((prevCart) => ({
      ...prevCart,
      [product.name]: (prevCart[product.name] || 0) + 1,
    }));
  };

  const total = Object.keys(cart).reduce((acc, name) => {
    const price = initialProducts.find((p) => p.name === name)?.price || 0;
    return acc + price * cart[name];
  }, 0);

  const handleCheckout = () => {
    const orderData = {
      email,
      address,
      postcode,
      cart,
      total,
    };

    fetch('http://localhost:8080/api/order', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(orderData),
    })
      .then((res) => res.json())
      .then((data) => {
        alert('결제 성공!');
      })
      .catch((err) => {
        console.error(err);
        alert('결제 실패!');
      });
  };

  return (
    <div style={{ backgroundColor: '#ddd', minHeight: '100vh', padding: '2rem' }}>
      <div className="container">
        <div className="row justify-content-center mb-4">
          <h1 className="text-center">Grids & Circle</h1>
        </div>

        <div className="card">
          <div className="row g-0" style={{ height: '100%' }}>
            <div className="col-md-8 d-flex flex-column justify-content-between">
              <div className="p-4 h-100 d-flex flex-column">
                <h5><b>상품 목록</b></h5>
                <div className="flex-grow-1 d-flex flex-column gap-3 justify-content-start">
                  {initialProducts.map(product => (
                    <div
                      key={product.id}
                      style={{
                        background: '#fff',
                        padding: '1rem 1rem',
                        borderRadius: '12px',
                        border: '1px solid #ddd',
                        minHeight: '100px',
                        display: 'flex',
                        alignItems: 'center',
                        width: '100%',
                        boxSizing: 'border-box'
                      }}
                    >
                      <ProductItem product={product} onAdd={addToCart} />
                    </div>
                  ))}
                </div>
              </div>
            </div>

            <div className="col-md-4 summary p-4">
              <Summary cart={cart} total={total} />

              <div className="mt-4">
                <h6>이메일</h6>
                <input
                  type="email"
                  className="form-control mb-2"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
                <h6>주소</h6>
                <input
                  type="text"
                  className="form-control mb-2"
                  value={address}
                  onChange={(e) => setAddress(e.target.value)}
                />
                <h6>우편번호</h6>
                <input
                  type="text"
                  className="form-control mb-3"
                  value={postcode}
                  onChange={(e) => setPostcode(e.target.value)}
                />
                <button className="btn btn-dark w-100" onClick={handleCheckout}>
                  결제하기
                </button>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
